import React from "react";
import { useParams } from "react-router-dom";
import { useRef } from "react";

function ProfilePage({ getUser, setUser }) {
  let inPic = useRef();
  const { em } = useParams();
  const user = getUser.find(({ email }) => email === em);
  console.log(em);
  function changePicture() {
    console.log(inPic.current.value);
  }
  return (
    <div className="user">
      <img src={user.picture} alt="" />
      <h1>{user.email}</h1>
      <input ref={inPic} type="url" />
      <button onClick={changePicture}> CHANGE PICTURE </button>
    </div>
  );
}

export default ProfilePage;
